#include "minixfs.h"
#include "minixfs_utils.h"
#include <assert.h>
#include <stdlib.h>
#include <stdio.h>
#include <string.h>

int main(int argc, char *argv[]) {
    file_system* fs = open_fs("test.fs");
    char *str = calloc(1, 400000);
    off_t off = 0;
    char *test = "";
    minixfs_write(fs, "/goodies/triplanetary.txt", test, strlen(test), &off);
    off = 0;
    minixfs_read(fs, "/goodies/triplanetary.txt", str, 220000, &off);
    puts(str);
    printf("off:%ld\n", off);
    free(str);
}
